import React, { Component } from "react";
import Bubble from "./Bubble";

class Navbar extends Component {
  render() {
    return (
      <nav className="navBar">
        <p className="logo">Logo</p>
        <Bubble/>
        <button className='btnC'>Carro</button>
      </nav>
    );
  }
}

export default Navbar;
